feature.on('click', e => {

  burnThis = parcel.getFeatureById('CVPA1')

  console.log('clicked', burnThis )

  burnThis.set({position: [3.5, 2.8, 1.35]})

  burnThisAnimation = burnThis.createAnimation('position') 
  burnThisAnimation.setKeys([
                { "frame": 0, "value": burnThis.position.add(new Vector3( 0, 0, 0 ) ) }, 
                { "frame": 32, "value": burnThis.position.add(new Vector3( -1.5, -0.125, 0 ) ) }, 
                { "frame": 62, "value": burnThis.position.add(new Vector3( -2.25, 0, 0 ) ) }, 
                { "frame": 92, "value": burnThis.position.add(new Vector3( -3, 0, 0 ) ) }, 
                { "frame": 122, "value": burnThis.position.add(new Vector3( -3.75, 0.25, 0 ) ) }, 
                { "frame": 145, "value": burnThis.position.add(new Vector3( -4.5, 0.143, 0 ) ) }, 
                { "frame": 172, "value": burnThis.position.add(new Vector3( -5.5, 0.25, 0 ) ) }, 
                { "frame": 180, "value": burnThis.position.add(new Vector3( -6.75, 0.25, 0 ) ) },
              ])  
  burnThis.startAnimations( [burnThisAnimation] )


  let smeltDoor= parcel.getFeatureById('smeltDoor')  
  let doorAnimation = smeltDoor.createAnimation('rotation')
  doorAnimation.setKeys([
    { frame: 0, value: smeltDoor.rotation.add( new Vector3(0, 0, 0)  ) }, 
    { frame: 60, value: smeltDoor.rotation.add( new Vector3(0, -1.4, 0)  ) },
    { frame: 120, value: smeltDoor.rotation.add( new Vector3(0, -1.4, 0)  ) },
    { frame: 180, value: smeltDoor.rotation.add( new Vector3(0, 0, 0)  )
  }]) 
  smeltDoor.startAnimations( [doorAnimation] )

  setTimeout(function() {
    let sound = parcel.getFeatureById('bS1')
    sound.play()   
  }, 6000); 

})

